            <Nav.Link 
              as={Link} 
              to="/casos" 
              active={location.pathname === '/casos'}
              className="px-3"
            >
              ðŸ“Š Casos Registrados
            </Nav.Link>
          </Nav>
        </BootstrapNavbar.Collapse>
      </Container>
    </BootstrapNavbar>
  );
};

export default Navbar;
